import React from 'react'
import logo from '../img/header/logo.svg'
import './header.css'


const Header = () => {
    return (
        <div className="image">
            <header className='header'>
                <a href="/" className="logo"><img src={logo} alt="logo" /></a>
            </header>
        </div>
    )
}

export default Header
